import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { ArrowLeft, Camera } from 'lucide-react';

const EditProfile = ({ user, setUser, theme }) => {
  const navigate = useNavigate();
  const isDark = theme === 'dark';

  // INITIALIZE STATE WITH USER DATA
  // Ensure we use 'college' and 'regNo' as keys
  const [formData, setFormData] = useState({
    name: user.name || '',
    college: user.college || '',       // <--- Ensure this matches user object key
    regNo: user.regNo || '',           // <--- Ensure this matches user object key
    email: user.email || '',
    profileImage: user.profileImage || ''
  });

  const styles = {
    container: {
      padding: '40px',
      backgroundColor: isDark ? '#0f172a' : '#f8fafc',
      minHeight: '100%',
      fontFamily: "'Inter', sans-serif",
      maxWidth: '800px',
      margin: '0 auto'
    },
    header: { display: 'flex', alignItems: 'center', gap: '15px', marginBottom: '30px', cursor:'pointer' },
    title: { fontSize: '24px', fontWeight: 'bold', color: isDark ? '#fff' : '#1e293b' },
    formGroup: { marginBottom: '20px' },
    label: { display: 'block', fontSize: '14px', fontWeight: '600', marginBottom: '8px', color: '#64748b' },
    input: {
      width: '100%', padding: '12px', borderRadius: '8px',
      border: isDark ? '1px solid #334155' : '1px solid #e2e8f0',
      backgroundColor: isDark ? '#1e293b' : '#fff',
      color: isDark ? '#fff' : '#1e293b',
      outline: 'none',
      fontSize: '15px'
    },
    saveBtn: {
      width: '100%', padding: '14px', backgroundColor: '#6366f1', color: '#fff',
      border: 'none', borderRadius: '10px', fontWeight: 'bold', fontSize: '16px',
      cursor: 'pointer', marginTop: '20px'
    },
    avatarSection: { textAlign: 'center', marginBottom: '30px', position: 'relative' },
    avatar: { width: '100px', height: '100px', borderRadius: '50%', objectFit: 'cover', border: '4px solid #fff', boxShadow: '0 4px 10px rgba(0,0,0,0.1)' },
    camIcon: { position: 'absolute', bottom: '0', left: '55%', backgroundColor: '#6366f1', color: '#fff', padding: '6px', borderRadius: '50%', cursor: 'pointer' }
  };

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSave = () => {
    // 1. UPDATE THE MAIN APP STATE
    setUser(prevUser => ({
      ...prevUser,
      name: formData.name,
      college: formData.college, // Updating College
      regNo: formData.regNo,     // Updating Reg No
      email: formData.email
    }));
    
    // 2. GO BACK TO PROFILE
    navigate('/profile');
  };

  return (
    <div style={styles.container}>
      <div style={styles.header} onClick={() => navigate('/profile')}>
        <ArrowLeft size={24} color={isDark ? '#fff' : '#333'} />
        <h1 style={styles.title}>Edit Profile</h1>
      </div>

      <div style={styles.avatarSection}>
        <img src={formData.profileImage} alt="Profile" style={styles.avatar} />
        <div style={styles.camIcon}><Camera size={16} /></div>
        <div style={{color: '#6366f1', fontSize: '13px', fontWeight: '600', marginTop: '8px', cursor:'pointer'}}>Change Profile Photo</div>
      </div>

      <div style={styles.formGroup}>
        <label style={styles.label}>Full Name</label>
        <input style={styles.input} name="name" value={formData.name} onChange={handleChange} />
      </div>

      <div style={styles.formGroup}>
        <label style={styles.label}>College Name</label>
        <input style={styles.input} name="college" value={formData.college} onChange={handleChange} />
      </div>

      <div style={styles.formGroup}>
        <label style={styles.label}>Register Number / ID</label>
        <input style={styles.input} name="regNo" value={formData.regNo} onChange={handleChange} />
      </div>

      <div style={styles.formGroup}>
        <label style={styles.label}>Email Address</label>
        <input style={styles.input} name="email" value={formData.email} onChange={handleChange} />
      </div>

      <button style={styles.saveBtn} onClick={handleSave}>Save Changes</button>
    </div>
  );
};

export default EditProfile;
